            this.setMarkets(this.markets);
        }
        // init the request rate limiter
        this.initRestRateLimiter();
        // sanbox mode
        object isSandbox = this.safeBool2(this.options, "sandbox", "testnet", false);
        if (isTrue(isSandbox))
        {
            this.setSandboxMode(isSandbox);
